css:
@-moz-document domain('karachan.org') {body {
    background: #1d1f21 none;
    color: #C5C8C6;
}

* {
    font-family: Roboto, "Helvetica Neue", Helvetica, Arial, Arial Unicode MS;
}

h1,
div.subtitle {
    color: #C5C8C6!important
}
a:link,
a:visited,
p.intro a.email {
    color: #81a2be
}
a:link:hover {
    color: #5F89AC
}
a.post_no {
    color: #C5C8C6
}
a.post_no:hover {
    color: #5F89AC!important
}
div.banner {
    background-color: #1d1f21
}
div.post.reply {
    background-color: #282a2e;
    border: 1px solid #282a2e;
    margin-bottom: 2px;
    margin-left: 16px;
    margin-top: 2px
}
div.post.reply.highlighted {
    background-color: #1d1d21;
    border: 1px solid #111
}
div.post.reply div.body a {
    color: #81a2be
}
div.post.reply div.body a:hover {
    color: #5F89AC
}
div.post-hover {
    border: 1px solid #000!important;
    box-shadow: none!important
}
.theme-catalog div.thread:hover {
    background-color: #1d1f21;
    border-color: #111
}
p.intro span.subject {
    color: #b294bb
}
p.intro span.name {
    color: #C5C8C6
}
span.quote {
    color: #adbd68
}
span.heading {
    color: #F20
}
form table tr th {
    background: #282a2e;
    border: 1px solid #111;
    color: #C5C8C6
}
div.ban h2 {
    background: #FCA;
    color: inherit
}
div.ban {
    border-color: #800
}
div.ban p {
    color: #000
}
div.pages {
    background: #1d1f21;
    border-color: #1d1f21
}
div.pages a.selected {
    color: #81a2be;
    font-weight: 700
}
div.boardlist {
    background-color: #282a2e!important;
    color: #C5C8C6
}
div.boardlist:nth-of-type(1) {
    border-bottom: 1px solid #111!important;
    box-shadow: 0 0 3px 0 #111
}
div.boardlist a {
    color: #81a2be
}
hr {
    background-color: #282a2e;
    border: 0;
    height: 1px
}
div#options_div {
    background-color: #282a2e
}
div.options_tab_icon {
    color: #AAA
}
div.options_tab_icon:hover {
    background-color: #111
}
div.options_tab_icon.active {
    color: #F20
}
div.blotter {
    color: #F20
}
span.omitted {
    color: #707070
}
p.intro a,
span.omitted a {
    text-decoration: none
}
form#quick-reply {
    padding-right: 1px;
    border: 1px solid #111
}
span.capcode {
    background-color: #000;
    padding: 2px 5px;
    border-radius: 10px
}
div#watchlist,
div#alert_div {
    border: 1px solid #111;
    background-color: #282a2e
}
div#watchlist a,
a.watchThread {
    color: #81a2be;
    text-decoration: none
}
div#watchlist a:hover,
a.watchThread:hover {
    color: #5F89AC
}
/* Remove the following parts if those annoy you */
/* Youtube borders */

div.video-container img.post-image {
    background-color: #000;
    border-color: #fff;
    border-width: 2px;
    border-style: none dotted none;
    padding: 0
}
/* Keep small thumbnails in replies */

.post.reply a:not([data-expanded="true"]) .post-image {
    width: auto!important;
    height: auto!important;
    max-height: 160px;
    max-width: 160px
}
.meny {
    background: #FFFEED!important;
    background-image: url(data:image/png;base64,)!important;
    background-repeat: repeat-x!important;
    background-attachment: fixed!important;
    background-position: top!important;
    color: #835B36!important;
}
div.sub-menu {
    box-shadow: 0px 3px 3px rgba(0, 0, 0, 0.1);
    background: #202020;
}
#settingsDiv {
    background: rgb(25, 25, 25);
    border: 1px solid rgb(48, 112, 169);
    border-radius: 5px;
}
#settingsTitle {
    background: #202020;
    border-bottom: 1px solid rgb(17, 17, 17);
}
#watcher_box {
    border: solid 1px;
    background: rgba(25, 25, 25, 0.5);
}
#watcher_title {
    background: rgb(25, 25, 25);
    border-bottom: 1px solid rgb(17, 17, 17);
}
.content {
    color: #d4d4d4;
    background: #343439;
    border: 1px solid #3070a9;
}
.content h3 {
    background: #202020;
    color: #d4d4d4;
    border: 1px solid #111;
}
.postContainer a {
    text-decoration: none;
}
.watch-button-container {
    color: #81a2be!important;
}
.fastform > .blockquoteReply > .captchaBlock {
    border: 1px solid rgb(170, 170, 170);
}
table:not(#postForm):not(#fastReplyButtons) tbody tr:nth-of-type(odd) {
    background-color: rgba(38, 38, 38, 0.9);
}
div.reply {
    background-color: #343439;
    border: 1px solid #3070a9;
    -webkit-border-radius: 5px;
    -o-border-radius: 5px;
    -moz-border-radius: 5px;
    border-radius: 5px;
    padding: 2px!important;
}
.next > form:nth-child(1) > input:nth-child(1) {
    color: #1d1f21;
    padding: 2px 5px;
    border: 1px outset #999;
    background-color: #333;
}
.prev > form:nth-child(1) > input:nth-child(1) {
    color: #1d1f21;
    padding: 2px 5px;
    border: 1px outset #999;
    background-color: #333;
}
input,
textarea,
select {
    border: 1px solid #888;
    background-color: #aaa;
    color: #000;
}
.modal-cont input[type="button"] {
    background: #1d1f21!important;
    color: #000!important;
    font-weight: bold;
}
.ladda-button {
    border: 1px solid #333;
    color: #D4D4D4;
}
.ladda-button:hover {
    border: 1px solid #333;
}
.ladda-button[data-loading] {
    background-color: rgba(0, 0, 0, 0.5)!important;
    border: 1px solid #333;
}
.ladda-progress {
    background: #292929!important;
}
.ladda-button[data-color="mint"] {
    background-color: #333;
}
.ladda-button[data-color="mint"]:hover {
    background-color: #292929;
}
.btn {
    border: 1px solid #333;
    background-color: #333;
    color: #D4D4D4;
}
.watch-link {
    text-decoration: none;
}
.btn:hover {
    background-color: #292929;
}
.BBButton {
    border: 1px solid #333;
    background-color: #333;
    color: #D4D4D4;
}
.modal-cont {
    background: #202020!important;
}
.modal-cont label {
    color: #d4d4d4!important;
}
.modal-cont input[type="button"] {
    background: #1d1f21!important;
    color: #fff!important;
    font-weight: bold;
}
#menu .modal-nav li {
    border-right: 1px solid #000;
    border-bottom: 1px solid #000;
    background-color: #1d1f21;
}
#menu .modal-nav li:hover {
    background-color: #202020;
    text-decoration: none;
}
#menu .modal-nav li:not(.tab-opened) {
    color: #C5C8C6;
}
#menu .modal-nav li:not(.tab-opened):hover {
    color: #D4D4D4;
}
.skandalBox {
    background: none repeat scroll 0% 0% #202020;
    border: 1px solid #1d1f21;
}
.skandalBox h2 {
    background-color: #1d1f21;
    color: #C5C8C6;
}
.skandalBox button {
    border: 1px solid #C5C8C6;
    background: #1d1f21;
    color: #fff;
}
.skandalBox button:hover {
    background: none repeat scroll 0% 0% #333;
}
span .name {
    color: #C5C8C6;
}
span.spoiler:hover,
span.spoiler:focus {
    color: #fff!important;
}
s,
s a:not(:hover) {
    color: #000!important;
    background: #000!important;
    text-decoration: none;
}
s:hover,
s:focus,
s:hover a {
    color: #d4d4d4!important;
}
.group-options span {
    color: #81a2be!important;
}
.group-options .fa {
    color: #81a2be!important;
}
input,
textarea,
select {
    border: 1px solid #888;
    background-color: #aaa;
    color: #000;
}
.ui-widget-header {
    background: #1d1f21;
    color: #999;
    border: 0px!important;
}
.ui-corner-all {
    background: #202020;
    border: solid 1px #888;
}
.captchaClickHere {
    background-image: url('data:image/png;base64,');
}
* {
    font-family: Roboto, "Helvetica Neue", Helvetica, Arial, Arial Unicode MS;
}
#quote-preview {
    background: #1d1f21;
    border: 1px solid #3b4a63;
    -webkit-border-radius: 5px;
    -o-border-radius: 5px;
    -moz-border-radius: 5px;
    border-radius: 5px;
    text-decoration: none!important;
}

.quotelink {
    text-decoration: none!important;
}
.postNum a {
    text-decoration: none!important;
}
.absBotDisclaimer {
    display: none;
}
.navLinks a {
    text-decoration: none!important;
}
#menu li a {
    text-decoration: none;
}
.pages a {
    text-decoration: none;
}
.next input {
    color: #C5C8C6!important;
    background-color: #333!important;
    box-shadow: none!important;
    border-style: none!important;
}
.prev input {
    color: #C5C8C6!important;
    background-color: #333!important;
    box-shadow: none!important;
    border-style: none!important;
}

}
